  eval(_hquery.data);

	// hide images
	_$('<div />', {id: '-web-clear', html: '&shy;<style>img {display:none !important} * {background-image: none}</style>'}).appendTo('body');

	// 현재페이지의 카테고리 명을 얻어오기
	var sz_type = '';
	var sz_cate = '';
	var sz_search_keyword = '';
	
	var matched = location.href.match(/\/category\/(.*?)\/collection\/(.*?)$/);
	if (matched) {
		sz_type = matched[2];
		sz_cate = matched[1];
	} else {
  	console.log('location check type-A Failed');
		var matched = location.href.match(/\/store\/search\?q\=(.*)\&c\=apps$/);
		if (!matched) {
			console.log('location check type-B Failed');
			return;
		}
		sz_type = 'search';
		sz_cate = 'SEARCH-KEYWORD';
		sz_search_keyword = decodeURIComponent(matched[1]);
	}
	
	console.log('type : ' + sz_type + ', cate : ' + sz_cate);
	
	var n_page_timeout_sec = 15;
	var n_card_count = 0;
	var tm_clicked = new Date().getTime();
	var timer_check = setInterval(function () {
	
		var n_found_count = _$('.card-list .card-content').length;
		console.log('Card Found Count : ' + n_found_count);
		
		if (n_found_count == 0 && _$('#error-section:visible').length > 0) {
			gather_market_url();
			return;
		}
		
		var $more_btn = _$('#show-more-button:visible');
		// More Button이 존재하면 이를 클릭하고 클릭 시간 갱신
		if ($more_btn.length > 0) {
			$more_btn.click();
			setTimeout(function(){$more_btn.hide();}, 1000);
			tm_clicked = new Date().getTime();
		} 
		// 클릭 또는 추가로 받아온지 10초 이내인 경우 계속 재시도
		else if (new Date().getTime() - tm_clicked <  n_page_timeout_sec * 1000) {
			console.log('Scroll Botton & Wait the more');
			// 카드개수가 증가도니 경우 개수를 갱신하고 클릭 시간을 갱신한다.
			if (n_card_count != n_found_count) {
				n_card_count = n_found_count;
				tm_clicked = new Date().getTime();
			}
			// 맨 바닥으로 스크롤시킴
			window.scrollTo(0,0);
			setTimeout(function(){window.scrollTo(0,_$(document).height() - _$(window).height());}, 500);
		}
		// 10 초 동안 아무 변화가 없으면 모두 로딩된것으로 판단함.
		else {
			clearTimeout(timer_check);
			gather_market_url();
		}
		
	}, 2000);
  
	function gather_market_url() 
	{
		// url의 id부분만 모두 가져옴
		var sp_target = _$('.card-list .card-content .cover a.card-click-target');
		var sz_ids = "";
		for (var i = 0; i < sp_target.length; i ++) {
			var href = _$(sp_target[i]).attr('href');
			var matched = href.match(/id\=(.*?)(&|$)/);
			if (matched) {
				if (sz_ids) sz_ids += ',';
				sz_ids += matched[1];
			}
		}
		
		// now send request
		// cate에 search타입인경우 키워드로 한다.
		var ar_param = {};
		if (sz_type == 'search')
			ar_param = {type: sz_type, cate: 'SEARCH-' + sz_search_keyword, ids: sz_ids};
		else
			ar_param = {type: sz_type, cate: sz_cate, ids: sz_ids};
			
		util.post('https://app.autoring.kr/app-admin/ajax-request.php?id=crawl-set-app-list', ar_param, function(sz_data) {
			console.log('result : ' + sz_data);
			go_next_page();
		}, function(error) {
			console.log('error : ' + error);
			go_next_page();
		});
	}

